import * as React from "react";
import Badge from "@mui/material/Badge";

export const Counter = ({ completeTasks, handleView }) => {
  return (
    <div>
      <Badge
        color="secondary"
        badgeContent={completeTasks.length === 0 ? 0 : completeTasks.length}
        onClick={handleView} //查看已完成任务
      ></Badge>
      <p>Task Complete</p>
    </div>
  );
};
